// src/pages/Main.js
import React from 'react';
//import { Link } from 'react-router-dom';
import './main.css'; // Ensure this CSS file exists and is correctly named

const Main = () => {
  return (
    <div className="button-container">
      <Link to='/sc'><button className="btn">StandUp Comedy</button></Link>
      <Link to='/lc'><button className="btn">Live Concerts</button></Link>
      <Link to='/ee'><button className="btn">Educational Events</button></Link>
      <Link to='/se'><button className="btn">Social Events</button></Link>
    </div>
  );
};

export default Main;
